import React from "react";
import { Container } from "react-bootstrap";
import Header from "../components/header";

const Landingpage = () => {
  return (
    <div style={{ backgroundColor: "#AAADC3" }}>
      <Container>
              <Header />
              <div style={{height:"100%"}}></div>
      </Container>
    </div>
  );
};

export default Landingpage;
